        return (
            <div id="ModelViewer">
                 <model-viewer ar src="media/3D-files/gltfTest.gltf" ios-src="media/3D-files/DSWMaterialFinal.usdz" camera-controls poster="DSW_Poster.png" alt="DSW Chair" background-color="#555555" auto-rotate align-model="center"></model-viewer>
          </div>
        )
    }
}

export default ModelViewer;
